import React, { useEffect, useState } from 'react'
import { useParams } from 'react-router-dom'

const AboutPages = ({list}) => {
  const {id} = useParams()
  const item = list.find((item) => item.id === parseInt(id));
  
  return (
    <div>
      <h2>{item.title}</h2>
    </div>
  )
}

export default AboutPages
